        }}
      >
        <Tabs defaultActiveKey="1">
          <TabPane tab="skills" key="1">
            <AdminSkills />
          </TabPane>
          <TabPane tab="projects" key="2">
            <AdminProjects />
          </TabPane>
        </Tabs>
      </div>
    </>
  );
};

export default Index;
